-- ------------------------------------------------
-- Version: v1.17
--
-- Description: Migration that introduces the case study table
-- -------------------------------------------------

CREATE TABLE k_CaseStudy (
    ID_CAS integer,
    lodCAS character varying(255) NOT NULL,
    IDN character varying(255),
    labelCaseStudy character varying(255),
    descCaseStudy text,
    lodCOU character varying(255),
    CountryScope character varying(255),
    lodTCS character varying(255) NOT NULL,
    lodCAS_V character varying(255),
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodCAS),
    FOREIGN KEY (lodTCS) REFERENCES k_Type_Case(lodTCS) ON DELETE CASCADE
);

